import { useState } from "react";
import "./Navbar.css"

const Navbar = () => {
    
    const [scrollPage, setScrollPage] = useState(false);
    window.onscroll = () => { 
        let offSetScreen = window.pageYOffset;
        console.log(offSetScreen);
        if(offSetScreen > 0)
            setScrollPage(true);
        else
            setScrollPage(false);
    };

    return (
        <div className={!scrollPage ? "Navbar" : "Navbar NavbarScrolled"}>
            <div className={!scrollPage ? "LogoBox" : "LogoBox LogoBoxScrolled"}>
                <img className={!scrollPage ? "LogoImage" : "LogoImage LogoImageScrolled"}/>
            </div>
            <div className={!scrollPage ? "UBox" : "UBox UBoxScrolled"}>
                <ul>
                    <li><Link to="/inicio/index/">In√≠cio</Link></li>
                    <li>Eventos</li>
                    <li>Contato</li>
                    <li>Quem somos</li>
                </ul>
            </div>
        </div>
    );

}

export default Navbar;
